    function checkboxString2(segmento){

        var grupo = document.getElementById(segmento);
        var lista = grupo.getElementsByTagName('input');
        var cadena = [];
        var j = 0;


        for (var n=0, len=lista.length; n<len; n++) {
            if ( lista[n].type === 'checkbox' ) {
                if (lista[n].checked){
                    cadena[j]=lista[n].id + '-' + lista[n].value;
                    j++;
                }
            }
        }
        var salida = "";
        for (var nn=0, len=cadena.length; nn<len; nn++){
            salida += cadena[nn] + '\n';
        };

        return salida;
    }

    function cajaTexto(segmento){

        var grupo = document.getElementById(segmento);
        var cadena = "";


        for (var m=0, len=grupo.value.length; m<len; m++) {
            if (m == 28 || m == 56 || m == 84){
                cadena += '\n';  
            }
            cadena += grupo.value[m];
        };

        return cadena;
    }
